import React from "react";
import resume from "../components/assets/Daphne_Wu_Resume1.pdf";

const Resume = () => (
    <div className="projects bg-gray-100 p-10">
    <h2 className="text-2xl mb-4">My Resume</h2>
    {/* Embed the PDF */}
    <embed 
      src="/assets/resume.pdf"  // Path to your PDF in the public folder
      width="100%" 
      height="800px" 
      type="application/pdf"
    />
      {/* Download link */}
      <a
        href={resume} // Path to your PDF file
        download="resume.pdf"      // Suggested filename for download
        className="absolute bottom-10 text-white bg-blue-500 px-6 py-3 rounded-lg hover:bg-blue-600 transition"
      >
        Download Resume
      </a>
    </div>
  );

export default Resume;
